const aStyle = {
  listStyle: "none",
  textDecoration: "none",
};
const ulStyle = {
  ...aStyle,
  margin: "1px",
  padding: "1px",
  textAlign: "right",
};
const liStyle = {
  ...aStyle,
  display: "inline-block",
  padding: "10px",
  textBorderleft: "none",
};

export default {
  liStyle,
  ulStyle,
};
